import styles from "../../Css/nav.module.css";
import logo from "../../Images/frame.png";

function Nav() {
  return (
    <nav>
      <div className={styles.topnav} id="myTopnav">
  <img src={logo} alt="Nav logo"></img>
  <p>News</p>
  <p>Contact</p>
  <p>About</p>
  <a href="javascript:void(0)" className={styles.icon} onclick="myFunction() return false">&#9776;</a>
</div>
    </nav>
  );
}

export default Nav;
